 import React from "react";

const GifExpertApp = () =>{

    const categories = ['dragon ball', 'superman', 'gatubela'];

    return (
        <>
            <h2>Gif React App</h2>
            <hr />

            <ul>
                { 
                    categories.map((category, i) => {
                        return <li key={i} >{category}</li>
                    })
                }   
            </ul>
        </>
    ) 
}

export default GifExpertApp;
